def is_prime(n):
    if n > 2 and n % 2 == 0:
        return False
    for x in range(3, int(math.sqrt(n) + 1)):
        if n != x and n % x == 0:
            return False
    return True


primes = [p for p in range(3, 150) if is_prime(p)]


def calculate_prime_value(string_value):
    prod = -1
    for l in string_value:
        try:
            idx = string.ascii_lowercase.index(l)
            prime_value = primes[idx]
        except Exception:
            # print('Trouble with: {} in {} because {}'.format(l, str, ex))
            prime_value = 0
        if prod < 0:
            prod = prime_value
        else:
            prod *= prime_value
    return prod


def calculate_total_product(source_string):
    total_product = 1
    for source_word in [s.strip().lower() for s in source_string]:
        prime_value = calculate_prime_value(source_word)
        total_product *= prime_value
    return total_product


# --------------- Helpers that build all of the responses ----------------------

def build_speechlet_response(title, output, reprompt_text, should_end_session):
    return {
        'outputSpeech': {
            'type': 'PlainText',
            'text': output
        },
        'card': {
            'type': 'Simple',
            'title': "SessionSpeechlet - " + title,
            'content': "SessionSpeechlet - " + output
        },
        'reprompt': {
            'outputSpeech': {
                'type': 'PlainText',
                'text': reprompt_text
            }
        },
        'shouldEndSession': should_end_session
    }


def build_response(session_attributes, speechlet_response):
    return {
        'version': '1.0',
        'sessionAttributes': session_attributes,
        'response': speechlet_response
    }


